public void ConfigureServices(IServiceCollection services)
        { 
           AzureConfiguration azureConfig = new AzureConfiguration("AccountName",
                    "AccountKey", true, true
                ,"TableName","PartitionKey");
            services.AddAzureTableStorageCache(azureConfig);
            services.AddMvc();
        }
//To Use in Controller
   private readonly IDistributedCache _cache;
        public HomeController(IDistributedCache cacheMechanism)
        {
            _cache = cacheMechanism;
        }
//To Get Cache
 var data = await _cache.GetAsync("userCache");
//To Save Cache
 await _cache.SetAsync("userCache", Encoding.UTF32.GetBytes(data));
//

